###################  
#  PRINT_STANDART #
###################

.macro READ_int
	li $v0, 5	# read int
	syscall
.end_macro
.macro PRINT_int_register(%X)
	move $a0,%X
 	li $v0, 1
	syscall
.end_macro

.macro PRINT_string_asciiz(%X)
	la $a0, %X
 	li $v0, 4
	syscall
.end_macro 

####################### 
#   GET_TABLERO_i_j   #
#######################
#guarda en $a0 el contenido de la celda tablero[i][j]
# i = $a0
# j = $a1
# $a0 = tablero[i][j]
.macro GET_TABLERO_i_j
    la $t3, tablero         	# cargar tablero en $t3
    lw $t6, n			# matriz n x n
    move $t4, $a0           	# i
    move $t2, $a1		# j
    add $t4, $t4, $t4		# i = i*2
    add $t4, $t4, $t4		# i = i*2 => (i*4)
    add $t2, $t2, $t2		# j = j*2
    add $t2, $t2, $t2		# j = j*2 => (j*4)
    mul $t4, $t4, $t6		# i = i*n
    add $t4, $t4, $t2		# i = i*n + j
    add $t1, $t4, $t3    	# 
    lw $a0, 0($t1)       	# get+
    #move $a0,$v0
    li $v0,1	
    syscall
.end_macro

#######################  
#   SET_TABLERO_i_j   #
#######################
#Seteamos la posicion tablero[i][j]
# i = $a0
# j = $a1
# tablero[i][j] = %X   %X = registro que tiene el entero a setear en la matriz
.macro SET_TABLERO_i_j(%X)
    la $t3, tablero         	# cargar tablero en $t3
    lw $t6, n			# matriz n x n
    move $t4, $a0           	# i
    move $t2, $a1		# j
    add $t4, $t4, $t4		# i = i*2
    add $t4, $t4, $t4		# i = i*2 => (i*4)
    add $t2, $t2, $t2		# j = j*2
    add $t2, $t2, $t2		# j = j*2 => (j*4)
    mul $t4, $t4, $t6		# i = i*n
    add $t4, $t4, $t2		# i = i*n + j
    add $t1, $t4, $t3    	# 
    move $t0, %X			# $a0 = %X
    sw $t0, 0($t1)       	# tablero[i][j] = $a0
.end_macro   


#######################  
#        main         #
#######################

main:
	
	## ----------------- Despliegue y solicitud de los datos -----------------
        PRINT_string_asciiz(ini1)
